import Card from "../Card/Card"
import style from "./CardsContainer.module.css"
//tomo el array de dogs y por cada dog renderizar un componente Card

const CardsContainer =()=>{     //
    const dogs =[
        {   "id": "d24defa2-b696-4302-979f-ef3c5b722971",
            "name":"sara",
            "weight":"12",
            "height":"3",
            "life_span":11,
            "temperament":"amigable",
            "image":"undefirned",
            "creado": "2023-04-15T17:06:34.215Z"

          }, 
          {
            "id": "d24defa3-b696-4302-979f-ef3c5b722971",
            "name":"pablo",
            "weight":"12",
            "height":"3",
            "life_span":11,
            "temperament":"amigable",
            "image":"undefirned",
            "creado": "2023-04-15T17:06:34.215Z"

          }, 
          {
            "id": "d24defa5-b696-4302-979f-ef3c5b722971",
            "name":"mailo",
            "weight":"12",
            "height":"3",
            "life_span":11,
            "temperament":"amigable",
            "image":"undefirned",
            "creado": "2023-04-15T17:06:34.215Z"

          }



    ]
    return (
        <div className= {style.container}>
            {dogs.map(dog=>{
                return <Card   //cards recibe props de afuera 
                key={dog.id}
                id={dog.id}
                name={dog.name}
                weight={dog.weight}
                height={dog.height}
                life_span={dog.life_span}
                temperament={dog.temperament}
                image={dog.image}




                />

            })}

        </div>
    )

}

export default CardsContainer
